import { TokenComponent } from './token/token.component';
import {MatProgressBarModule} from '@angular/material/progress-bar'
@NgModule({
  declarations: [
    AppComponent,
    TokenComponent
  ],

  imports: [
    BrowserModule,
    AppRoutingModule,
    MatProgressBarModule
